        country = ing_tab_params_arr[1]
        tp = ing_tab_params_arr[2]
        print("===========" + ing_tab + "============")
        if table_id == '184':
            ing_tab_task = BashOperator(task_id="Ingestion_" + ing_tab + "_" + env,
                                        bash_command='sh -x /CTRLFW/FDP/{0}/ingestion/scripts/fdp_recon_check.sh {1} {2} {3} {4}'.format(
                                            env, order_date, env, table_id,
                                            base_score - int(ing_tab_id_to_params_map_weights[table_id].split(",")[3])),
                                        dag=dag,
                                        execution_timeout=timedelta(hours=20), priority_weight=base_score - int(
                    ing_tab_id_to_params_map_weights[table_id].split(",")[3]), weight_rule='absolute')
